import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './container/App';
import {Provider} from "react-redux";

const Apps = ()=>{
    <Provider>
      <App/>
      </Provider>
};

ReactDOM.render(
    <Apps />,
  document.getElementById('root')
);
